import React from "react";
import ReactDOM from "react-dom";
 import village, { dist, taluka,name, state } from "./App";
import * as ques from './App';

ReactDOM.render(
  <>
    <ol>
      <li>Kanji Bhanderi</li>
      <li>{ques.default}</li>
      <li>{ques.taluka}</li>
      <li>{ques.dist}</li>
      <li>{ques.name()}</li>
      <li>{ques.state()}</li>
    </ol>
  </>,
  document.getElementById("root")
);
